import React from 'react';

import logo from '../assets/logo.jpg'

const Navbar = () => {
  return (
    <div className='h-2 w-2'>
      <img src={logo} alt="logo"></img>
      <h2 className='text-red-500'>Personal Bookshelf</h2>
    </div>
  );
};

export default Navbar;
